// Please note that the sign data, the signature image and the RSA signature should be send back to the web application for further processing. The rest we don't need in web application?
interface SignatureData {
  command: string;
  returnCode: number;
  signData: string; // Further processing
  certId?: string;
  rsaSignature?: string; // Further processing
  signatureImage?: {
    command: string;
    returnCode: number;
    file: string;
  };
  signatureCert?: {
    command: string;
    returnCode: number;
    file: string; // Further processing
  };
}

export default function GetSignature() {
  const [signatureData, setSignatureData] = useState<SignatureData | null>(
    null
  );
  const [error, setError] = useState<string | null>(null);

  const fetchSignatureData = async () => {
    try {
      const response = await fetch("/api/signature");
      if (response.ok) {
        const data = await response.json();
        setSignatureData(data.signatureData);
        setError(null);
      } else {
        setError("No signature data available");
        setSignatureData(null);
      }
    } catch (error) {
      console.error("Error fetching signature data:", error);
      setError("Failed to fetch signature data");
      setSignatureData(null);
    }
  };

  return (
    <div>
      <h1>Signotec Signature Data</h1>
      <button onClick={fetchSignatureData}>Fetch Signature Data</button>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {signatureData && (
        <div>
          <h2>Signature Data:</h2>
          <pre>{JSON.stringify(signatureData, null, 2)}</pre>
          {/* Sign Data */}
          <p>
            <strong>Sign Data</strong>:{" "}
            {/* Shortened the signData string, so it doesnt take too much space */}
            {signatureData?.signData.substring(0, 50)}...
          </p>
          {/* RSA Signature */}
          <p>
            <strong>RSA Signature</strong>: {signatureData?.rsaSignature}
          </p>
          {/* Signature Image */}
          <img
            id="Signature_0"
            alt="Signature 0"
            src={`data:image/png;base64,${signatureData?.signatureImage?.file}`}
          />
        </div>
      )}
    </div>
  );
}

